import React from 'react';

import './global.css'
import './App.css'

// import Header from './Header'

function App() {
  return (
    <div id="app">
      <aside>
        <strong> Cadastrar </strong>
        <form>
          <label htmlFor=""> Github's username </label>
          <input name="github_username" id="github_username" required></input>
        </form>
      </aside>
      <main></main>
    </div>
  );
}

export default App;
